          <Route exact path="/" component={Home} />
          <Route exact path="/movie" component={movies} />
          <Route exact path="/newMovie" component={newMovieform} />
          <Route path="/" component={Error404} />
        </Switch>
      </BrowserRouter>
    </CurrentUserProvider>
  );
}

export default App;
